import { Box, Stack, Typography, Avatar, Chip, IconButton, Tooltip, Grid, Table, TableBody, TableCell, TableRow } from "@mui/material";
import EditIcon from "@mui/icons-material/Edit";
import SendIcon from "@mui/icons-material/Send";
import StarIcon from "@mui/icons-material/Star";
import GroupAddIcon from "@mui/icons-material/GroupAdd";
import CreditCardIcon from "@mui/icons-material/CreditCard";
import PersonIcon from "@mui/icons-material/Person";

export default function ProfileHeader({ profile, onEdit, onSend }) {
  return (
    <Box sx={{
      bgcolor: "#fff",
      borderRadius: 4,
      boxShadow: "0 2px 10px rgba(20,25,55,0.08)",
      p: { xs: 2, md: 4 },
      mb: 3,
      display: "flex",
      flexDirection: { xs: "column", sm: "row" },
      alignItems: { xs: "flex-start", sm: "center" }
    }}>
      <Avatar
        sx={{
          width: 110, height: 110, fontSize: 44, bgcolor: "#EEF1F7",
          color: "#4361EE", border: "4px solid #F2F4F8", mr: { sm: 4, xs: 0 }, mb: { xs: 2, sm: 0 }
        }}>
        {profile.name.split(" ").map(part => part[0]).join("").toUpperCase()}
      </Avatar>
      <Box flex={1}>
        <Typography variant="h3" fontWeight={700} color="#1A2340" mb={1}>
          {profile.name}
        </Typography>
        <Stack direction="row" alignItems="center" spacing={1} mb={2}>
          <PersonIcon fontSize="small" sx={{ color: "#90A4AE" }} />
          <Typography sx={{ fontSize: 18, color: "#5D6C86" }}>
            ID: {profile.id} &nbsp;|&nbsp; {profile.age} лет &nbsp;|&nbsp; {profile.city}, {profile.country}
          </Typography>
        </Stack>

        {/* МЕТКИ */}
        <Stack direction="row" spacing={1} mb={2} flexWrap="wrap">
          <Chip icon={<StarIcon sx={{ color: "#F9B21A" }} />} label="VIP" sx={{
            bgcolor: "#FFF8E1", color: "#F9B21A", fontWeight: 700, border: "2px solid #F9B21A"
          }} />
          <Chip icon={<StarIcon sx={{ color: "#D9B262" }} />} label="Gold" sx={{
            bgcolor: "#FFFBE7", color: "#D9B262", fontWeight: 700, border: "2px solid #D9B262"
          }} />
          <Chip icon={<GroupAddIcon sx={{ color: "#FB8C00" }} />} label={`Рефералы: ${profile.referrals || 8}`} sx={{
            bgcolor: "#FFF3E0", color: "#FB8C00", fontWeight: 700, border: "2px solid #FB8C00"
          }} />
          {/* остальные теги */}
          <Chip label="Постоянный клиент" sx={{ bgcolor: "#E3F2FD", color: "#1976d2", fontWeight: 500 }} />
          <Chip label="Гость сайта" sx={{ bgcolor: "#ECEFF1", color: "#607D8B", fontWeight: 500 }} />
          <Chip label="Отзывчивый" sx={{ bgcolor: "#F3F6FC", color: "#536dfe", fontWeight: 500 }} />
          <Chip icon={<CreditCardIcon sx={{ color: "#43a047" }} />} label="Карта: Активна" sx={{
            bgcolor: "#E6F5EA", color: "#43a047", fontWeight: 700, border: "2px solid #B0E3C0"
          }} />
        </Stack>

        {/* КНОПКИ */}
        <Stack direction="row" spacing={1} mt={1} justifyContent="flex-end">
          <Tooltip title="Отправить сообщение">
            <IconButton sx={{ bgcolor: "#EEF0F7" }} onClick={onSend}>
              <SendIcon sx={{ color: "#3949ab" }} />
            </IconButton>
          </Tooltip>
          <Tooltip title="Редактировать профиль">
            <IconButton sx={{ bgcolor: "#EEF0F7" }} onClick={onEdit}>
              <EditIcon sx={{ color: "#1A2340" }} />
            </IconButton>
          </Tooltip>
        </Stack>

        {/* ТАБЛИЦА ОСНОВНЫХ ПОЛЕЙ */}
        <Table sx={{
          mt: 2,
          "& td, & th": { border: "none", fontSize: 17, py: 0.7 }
        }}>
          <TableBody>
            <TableRow>
              <TableCell>Email:</TableCell>
              <TableCell>{profile.email}</TableCell>
              <TableCell>Телефон:</TableCell>
              <TableCell>{profile.phone}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Дата рождения:</TableCell>
              <TableCell>{profile.dob.split("-").reverse().join(".")}</TableCell>
              <TableCell>Пол:</TableCell>
              <TableCell>{profile.gender}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Тип клиента:</TableCell>
              <TableCell>{profile.clientType}</TableCell>
              <TableCell>Город:</TableCell>
              <TableCell>{profile.city}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Адрес:</TableCell>
              <TableCell>{profile.address}</TableCell>
              <TableCell>Язык интерфейса:</TableCell>
              <TableCell>{profile.lang}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Согласие на рассылку:</TableCell>
              <TableCell>{profile.marketing ? "Да" : "Нет"}</TableCell>
              <TableCell />
              <TableCell />
            </TableRow>
          </TableBody>
        </Table>
      </Box>
    </Box>
  );
}
